function NewComment(props){
   return(
      <div className="comment__displayed">
        <div className="comment__icon">{props.commentIcon}</div>
        <div className="comment__details">
            <div className="comment__label">
                <div className="comment__name">{props.name}</div>
                <div className="comment__date">{props.commentDate}</div>
            </div>
            <div className="comment__text">{props.comment}</div>
        </div>
    </div>
    );
}

export default NewComment;
